// src/components/blog/InteractiveDemo.js
import React from 'react';

// This component renders any React children passed to it
// It's used for interactive demos within blog posts
const InteractiveDemo = ({ children }) => {
  // The children prop is expected to be a function that returns a React element
  return (
    <div className="my-6 bg-white">
      {typeof children === 'function' ? children() : children}
    </div>
  );
};

export default InteractiveDemo;
